import { useNavigate } from "react-router-dom";
// import { Link } from "react-router-dom";

const Potions = (props) => {
  const navigate = useNavigate();
    console.log(props.potions)
  return (
    <div className="containerSpells">
      <button onClick={() => navigate(-1)}><img src="../icons/arrow_back.svg" alt="back"/></button>
      <div className="data">
      <div>
      <h1>POtions</h1>
        <p>Learn your potions</p>
      </div>

        <div className="spells">

		  <table className="spellTable">
			<thead>
				<th>Name</th>
				<th>Effect</th>
                <th></th>
			</thead>
			<tbody>
		  		{props.potions.map((value,index)=>{
					return <tr key={index}>
						<td>{value.name}</td>
						<td>{value.effect}</td>
					</tr>
				})}
			</tbody>
		  </table>
        </div>

      </div>
    </div>
  );
};

export default Potions;
